import './SelectFlight.css';

const SelectFlight = (props) => {
    return (
        <div className="SelectFightContainer">
            <div className="SelectedFlight"></div>
            <div className="controls"></div>
            <button>Book</button>
        </div>
    )
}

export default SelectFlight;
